import React from "react";
import styles from "./photo.module.css";
import photo from './photo.js';

function Photo (){
  
    return(
    <div className={styles.photo} key ={Photo.img}>          
        <h1 className={styles.photoName}>Смартфон Apple iPhone 13,синий</h1>
        <div className={styles.photoRow}> 
            {photo.map((item) => (                  
                <img src={item.image} alt={item.alt} className={item.id} />   
            ))} 
        </div>                                                                  
    </div>

)
}
 
export default Photo
